/** @format */
import React from 'react';

import { ReactComponent as Github } from '/../public/images/Github.svg';

function Footer() {
	return (
		<>
			<div className='relative'>
				<div className='mt-52 px-14 py-10 bg-black text-white w-full'>
					<div className='flex justify-between	'>
						<h1 className='font-extrabold'>My Logo</h1>
						<div className='flex'>
							<ul>
								<li>Github</li>
							</ul>
						</div>
					</div>
				</div>
			</div>
		</>
	);
}

export default Footer;
